import "./Pokemon.css";
import {CgPokemon} from "react-icons/cg"

const Pokemon = ({pokemon}) => {

    const pokemonData = import("../data/pokemon_data/pokemon_" + pokemon.id + "_data.json");

    return (
        <div className={"Pokemon"}>
            <div className={"number"}><CgPokemon/>{pokemonData.id} </div>
            <img className={"pokemonImage"} src={pokemon.imageURL} alt={pokemon.name}/>
            <div
                className={"pokeName"}> {pokemonData.name.split("-")[0][0].toUpperCase() + pokemonData.name.split("-")[0].slice(1)}</div>
        </div>
    )
}

export default Pokemon;
